import React from 'react';

const PatientSchedule = () => {
  return (
    <div className="patient-schedule">
      <div className="container">
        <h1>My Schedule</h1>
        <p>Patient schedule management coming soon...</p>
      </div>
    </div>
  );
};

export default PatientSchedule;
